const Navigation = () => {

    const nav_value = {
        orderCall:"Замовлення дзвінка"
    }

    return(
        <>
            <div className="navigation">
                <button>{nav_value.orderCall}</button>
                <button></button>
                <button></button>
                <button></button>
                <button></button>
                <button></button>
                <button></button>
            </div>
        </>
    )
}

export default Navigation;
